/*Table structure for table `players` */

DROP TABLE IF EXISTS `players`;

CREATE TABLE `players` (
  `id` int(10) unsigned NOT NULL,
  `sport_id` bigint(20) unsigned NOT NULL,
  `is_published` tinyint(4) DEFAULT NULL,
