  `active` int(10) DEFAULT NULL,
  `dob` date DEFAULT NULL,
  `dod` date DEFAULT NULL,
  `weight` float DEFAULT NULL,
  `height` float DEFAULT NULL,
  `batting_style` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
