  `is_published` tinyint(4) DEFAULT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `name_hindi` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `short_name` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL,
  `short_name_hindi` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL,
  `image_id` bigint(20) NOT NULL,
  `country` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `code` varchar(8) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  -- `coach_id` bigint(20) unsigned DEFAULT NULL,
  `logo` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `stadium` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `stadium_hindi` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `major_honour` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `major_honour_hindi` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `year_founded` year(4) DEFAULT NULL,
  `twitter` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `snapchat` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `insta` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `fb` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `website` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_hindi` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `meta_description` mediumtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `meta_description_hindi` mediumtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `stand_first` tinytext COLLATE utf8mb4_unicode_ci NOT NULL,
  `stand_first_hindi` tinytext COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`,`sport_id`),
  UNIQUE KEY `team_slug_unique` (`slug`),
  -- KEY `coach_id_fk` (`coach_id`),
  KEY `sport_id_fk` (`sport_id`),
